import "./blog.css";
import Logo from "../../img/logo.png";
import NavBar from "../../components/navBar/navBar";

export default function Blog(){
    return(
        <div className="Blog">
            <div className="blogTop">
                <NavBar Logo={Logo}/>
            </div>
          
        </div>
    );
}
